const BitcoinNews = ({ bitcoinNews }) => {
    return (
        <div className="row">
            {bitcoinNews.map(element => {
                return (
                    <div className="col-md-6 col-12 mb-4">
                        <h1>news</h1>
                    </div>
                )
            })}
        </div>
    );
}

export default BitcoinNews;
